    "FooGallery.utils.fn.html#.check": {
      "id": "FooGallery.utils.fn.html#.check",
      "kind": "function",
      "title": "&lt;static&gt; check( thisArg, value [, def [, ctx ] ] )  {function}",
      "longname": "FooGallery.utils.fn.check",
      "name": "check",
      "tags": "FooGallery.utils.fn.check utils.fn.check fn.check check",
      "summary": "Checks the given value and ensures a function is returned.",
      "description": "This function is primarily used to check the value of a callback option that could be supplied as either a function or a string. When just the function name is supplied this method uses the FooGallery.utils.fn.fetch method to resolve and wrap it to ensure when it's called the correct context is applied. Being able to resolve a function from a name allows callbacks to be easily set even through data attributes as you can just supply the full function name as a string and then use this method to retrieve the actual function."
    },
