    "FooGallery.utils.fn.html#.enqueue": {
      "id": "FooGallery.utils.fn.html#.enqueue",
      "kind": "function",
      "title": "&lt;static&gt; enqueue( objects, name [, arg1 [, ...argN ] ] )  {jQuery.Promise}",
      "longname": "FooGallery.utils.fn.enqueue",
      "name": "enqueue",
      "tags": "FooGallery.utils.fn.enqueue utils.fn.enqueue fn.enqueue enqueue",
      "summary": "Enqueues methods using the given name from all supplied objects and executes each in order with the given arguments.",
      "description": "This method allows an array of objects that implement a common set of methods to be executed in a supplied order. Each method in the queue is only executed after the successful completion of the previous. Success is evaluated as the method did not throw an error and if it returned a promise it was resolved. An example of this being used within the plugin is the loading and execution of methods on the various components. Using this method ensures components are loaded and have their methods executed in a static order regardless of when they were registered with the plugin or if the method is async. This way if ComponentB's preinit relies on properties set in ComponentA's preinit method you can register ComponentB with a lower priority than ComponentA and you can be assured ComponentA's preinit completed successfully before ComponentB's preinit is called event if it performs an async operation."
    },
